import { SET_BILLING_ADDRESS, SET_DELIVERY_TIMING, SET_PAYMENT_METHOD, SET_SELECTED_ORDER, SET_SHIPPING_ADDRESS, SET_SHIPPING_AREA } from '../types';

export const setBillingAddress = (payload: any) => {
    return (dispatch) => {
        dispatch({ type: SET_BILLING_ADDRESS, payload });
    }
}

export const setShippingAddress = (payload: any) => {
    return (dispatch) => {
        dispatch({ type: SET_SHIPPING_ADDRESS, payload });
    }
}

export const setDeliveryTiming = (payload: any) => {
    return (dispatch) => {
        dispatch({ type: SET_DELIVERY_TIMING, payload });
    }
}

export const setPaymentMethod = (payload: any) => {
    return (dispatch) => {
        dispatch({ type: SET_PAYMENT_METHOD, payload });
    }
}

export const setShippingArea = (payload: any) => {
    return (dispatch) => {
        dispatch({ type: SET_SHIPPING_AREA, payload });
    }
}

export const setSelectedOrder = (payload: any) => {
    return (dispatch) => {
        dispatch({ type: SET_SELECTED_ORDER, payload });
    }
}
